import React from "react";
import {
  Media,
  Navbar,
  Nav,
  NavItem,
  NavLink,
  DropdownToggle,
  DropdownMenu,
  DropdownItem,
  Row,
  Container,
  Dropdown
} from "reactstrap";
import styled from "styled-components";
import FaCog from "react-icons/lib/fa/cog";
// import MdPageview from "react-icons/lib/md/pageview";
import FaPowerOff from "react-icons/lib/fa/power-off";

export default class RenderNavbar extends React.Component {
  constructor(props) {
    super(props);

    this.toggle = this.toggle.bind(this);
    this.state = {
      dropdownOpen: false
    };
  }

  toggle() {
    this.setState(prevState => ({
      dropdownOpen: !prevState.dropdownOpen
    }));
  }

  render() {
    return (
      <Navbar expand="md" style={{ padding: "0" }}>
        <Logo>
          <Media object src="image/logo-white.png" />
        </Logo>
        <Container>
          <Row>
            <Nav navbar style={{ marginLeft: "110px" }}>
              <NavItemsEnd>
              </NavItemsEnd>
            </Nav>
          </Row>
        </Container>
        <UncontrolledDropdownX
        inNavbar={true}
        isOpen={this.state.dropdownOpen}
        toggle={this.toggle}
      >
        <DropdownToggleX nav>
          Select Language
        </DropdownToggleX>

        <DropdownMenuZ>
          <DropdownItemY href={"/profile"}>
          <p>Polish</p>
          </DropdownItemY>
          <DropdownItemY href={"/signin"}>
           English
          </DropdownItemY>
        </DropdownMenuZ>
      </UncontrolledDropdownX>

        <UncontrolledDropdownX
          inNavbar={true}
          isOpen={this.state.dropdownOpen}
          toggle={this.toggle}
        >
          <DropdownToggleX nav>
            My organization
          </DropdownToggleX>

          <DropdownMenuZ>
            <DropdownItemY href={"/profile"}>
            <p>sample data from api</p>
            </DropdownItemY>
            <DropdownItemY href={"/signin"}>
              <FaPowerOff style={{ margin: "5px", marginBottom: "7px" }} /> Log
              out
            </DropdownItemY>
          </DropdownMenuZ>
        </UncontrolledDropdownX>
      </Navbar>
    );
  }
}

const Logo = styled.div`
  background-color: #9585c4;
  padding: 20px 25px;
`;

const NavItemsEnd = styled(NavItem)`
  padding: 12px 40px;
  border: 2px solid #ebf2fa;
  &:hover {
    border-bottom: 2px solid #4ec2e2;
  }
`;

const UncontrolledDropdownX = styled(Dropdown)`
  width: 400px;
  font-weight: 500;
  padding: 0px 20px;
  border-left: 1px solid #eee;
`;

const DropdownMenuZ = styled(DropdownMenu)`
  border-top: 0;
  background-color: #fff;
  width: 100%;
  border-radius: 3px;
`;

const DropdownItemY = styled(DropdownItem)`
  border-top: 0;
  color: #94a2bf;
  &:hover svg {
    color: #4ec2e2;
  }
`;

const DropdownToggleX = styled(DropdownToggle)`
  color: #94a2bf;
`;
